    position: absolute;
    width: 1px;
    margin-top: 90px;
    background-image: linear-gradient(#EBEBEB 50%, rgba(255,255,255,0) 0%);
    background-size: 1px 12px;
    background-repeat: repeat-y;
    height: 1200px;
`

const DotLine2 = styled.div`
    position: absolute;
    right: 0;
    width: 1px;
    margin-top: 90px;
    background-image: linear-gradient(#EBEBEB 50%, rgba(255,255,255,0) 0%);
    background-position: right;
    background-size: 1px 12px;
    background-repeat: repeat-y;
    height: 540px;
`


function App() {
  return (
    <div className="App">
      <LandingSection />
    </div>
  );
}

export default App;
